import "./post.css";

function Post() {
  return (
    <div className="post">
      <img
        className="postImg"
        src="data:image/jpeg;base64,"
        alt=""
      ></img>
      <div className="posyInfo">
        <div className="postCats">
            <span className="postCat"></span>
            </div>
      </div>
    </div>
  );
}

export default Post;
